import react from "react";

const TaskList = (task) => {
    return (
        <div>
            <tr>
                <td>{task.id}</td>
                <td>{task.Description}</td>
                <td>{task.TimeFrame}</td>
            </tr>
        </div>
        );
};

export default TaskList;
